import Locations from './pic/location.png';
const Location = () => {
    return (
        <div>
            <div id="main" class="clear">
                <div id="sidebar"></div>
                <div id="page-wrap"> <img src={Locations} alt="Logo" />; </div>
            </div>

        </div>
    );
}

export default Location;
